import React from "react"
import Card from 'react-bootstrap/Card';
import Button from '../Button/button.js';

class MyCard extends React.Component{
  constructor(props){
    super(props)
  }
  render() {
    return(
      <Card className = {this.props.item.classN}>
        <Card.Img className={this.props.item.img.classN} variant={this.props.item.img.variant} src={this.props.item.src} />
        <Card.Body>
          <Card.Title className = "title">{this.props.item.title}</Card.Title>
          <Card.Text className = "text">{this.props.item.text}</Card.Text>
          <Button
            btn_variant={this.props.item.button.variant}
            btn={this.props.item.button.btn}
            />
        </Card.Body>
      </Card>
    )
  }
}
export default MyCard
